import React from 'react';
import { Grid, Container, AppBar, Tabs, Tab, Box, Button} from '@material-ui/core';
// import TabPanel from '@material-ui/lab/TabPanel';
// import "./App.css";

class App extends React.Component {
  render() {
    return (
      <Grid item className="App" direction="row">
        <AppBar position="static">
          <Tabs aria-label="simple tabs example">
            <Tab label="Item One" />
            <Tab label="Item Two" />
            <Tab label="Item Three" />
          </Tabs>
        </AppBar>
        <Container maxWidth='xl'>
          <form>
            <input type="text" value="HelloWorld"></input>
          </form>
          <Box component="span" m={12}>
            <Button variant="contained" color="primary">Press me</Button>
          </Box>
        </Container>
      </Grid>
    );
  }
}

export default App;
